export const rowValues = ['a','b','c','d','e','f','g','h'];

export const colValues = [1,2,3,4,5,6,7,8];

export enum PieceType{
    PAWN = 'pawn',
    BISHOP = 'bishop',
    KNIGHT = 'knight',
    ROOK = 'rook',
    QUEEN = 'queen',
    KING = 'king'
}

export enum PlayerColor{
    WHITE = 'white',
    BLACK = 'black'
}
